import styled from 'styled-components';

export const Item = styled.li`
    width: 100%;
    margin: 10px 0;
    border-radius: 10px;
    display: flex;
    justify-content: space-between;
    align-items: center;
    background-color: pink;
`;

export const ItemContainer = styled.div`
    display: flex;
    align-items: center;
    gap: 10px;
    background-color: purple;
`;
